import{_ as t,c as e,o as s,a5 as o}from"./chunks/framework.CByBVyi2.js";const d=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"timeline/issue-40.md","filePath":"timeline/issue-40.md","lastUpdated":1734312897000}'),i={name:"timeline/issue-40.md"},l=o('<blockquote><p>今天在群里看到有人问这个问题，想起来自己之前也经常会遇到这个问题：console.log打印对象，结果发现对象展开的内容是和默认展示的不一样</p></blockquote><div class="tip custom-block"><p class="custom-block-title">原文地址</p><p><a href="https://github.com/jynba/jynba.github.io/issues/40" target="_blank" rel="noreferrer">为什么console.log打印的对象(数组)和展开的内容不对应？ | GitHub</a></p></div><ul><li><strong>问题：</strong></li></ul><p><img src="https://github.com/jynba/jynba.github.io/assets/75623303/045f1b5e-5b05-4b83-82d8-a69793feb888" alt="image"> 由上图可以发现，在我们打印后再去对打印的对象进行修改，此时打印的东西<strong>展开</strong>后也会随之更改 这是为什么呢？</p><ul><li><p><strong>原因：</strong> console.log默认显示的内容如果是对象的话，只是显示对象的要用地址，在展开是会循着地址找到对象，若是我们console.log后又修改了对象，我们看到的东西也会变成修改后的内容</p></li><li><p><strong>解决方案：</strong> 可以通过 JSON.stringify将对象用字段串的形式打印出来</p></li></ul>',5),a=[l];function n(r,c,_,p,u,g){return s(),e("div",null,a)}const m=t(i,[["render",n]]);export{d as __pageData,m as default};
